er personal data being gathered and used by third parties without your consent, we recommend that, when putting your email address or other personal data in discussion groups, conversations or other publicly available forums, you do so with increased caution. Further information and instructions for the safe use of ŠKODA AUTO technical communities is given below.??Use of Personal Data</p>          <p>Personal data gathered at this application will be used for your personification and to provide the products and services that you requested or to which you consented. ŠKODA AUTO can use personal data to provide better quality customer services, to innovate its application and all related ŠKODA AUTO products and services, and to simplify the use of this application, which can be achieved by eliminating the necessity of repeatedly inputting the same information and having the  application adapt itself to the user’s specific preferences and interests. The information gathered by the application can be used for the purpose of obtaining comprehensive information about contacts with ŠKODA AUTO related to information gathered using other ŠKODA AUTO services.??You agree that we can use your personal data to provide you with important information about a product or service that you use, including important updates and warnings. With your consent we can also send you information about other ŠKODA AUTO products and services and share information with our partners, who can also send you information about ŠKODA AUTO products and services.??For research purposes we can combine information about visitors to the application with anonymous demographic information. We can use such information to increase the attractiveness of content. In such sections of the application with restricted access we can, with your consent, combine information about visits to the application with your personal information, to provide you with content adapted directly for you.</p>          <p>In some cases ŠKODA AUTO provides certain services (such as web hosting, packaging, sending and delivering prizes, replies to customers’ questions about products and services and information about our products, special offers and other new services) through another company. We only provide these companies with the personal data that are necessary to implement a specific service. In addition, we require them to handle the information thoroughly in accordance with the relevant provisions and not use them for other purposes.</p>          <p>ŠKODA AUTO can disclose personal data to third parties only in the following cases, when it is ordered or enabled by the law or in good faith that such action is necessary to: (a) comply with the law of the country in question and the legal procedures of ŠKODA AUTO; (b) protect and defend the rights or property of ŠKODA AUTO and its applications; or (c) in urgent cases to protect the safety of ŠKODA AUTO employees and business partners, ŠKODA AUTO product and service users and the public.</p>          <p>Personal data gathered at the application can be stored and processed in a country in which ŠKODA AUTO and its branches, affiliates, or representatives have the relevant facilities.</p>          <p><strong>Checks on personal data</strong></p>          <p>Unless this declaration provides otherwise, the personal data you provide at this application will not be communicated outside ŠKODA AUTO and its branches and affiliates.</p>          <p><strong>Personal Data Security</strong></p>          <p>ŠKODA AUTO pays great attention to personal data security. With the help of a whole number of security technologies and procedures we help protect your personal data from unauthorized access, use or publication.??Changes in personal data protection principles</p>          <p>We may update this declaration in case of need. If this happens, we will alter the last update date in this declaration. We will inform you of amendments to this declaration in a notice we